def check_urgent_messages(df: pd.DataFrame) -> str:
    urgent_messages = df[df["message"].str.contains("urgent", case=False)].copy()
    urgent_messages["message"] = urgent_messages["message"].str.replace("urgent", "URGENT", case=False)
