    for edge in edges:
        nodes[edge[0]].outgoing_edges.append((edge[1], edge[2]))
        nodes[edge[1]].incoming_edges.append((edge[0], edge[2]))

    return dfs(set(), 0, 0, nodes[start], k, float("inf"), target, nodes)

